import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
	state:{
		route:"",
	},
	mutations: {
		setRoute(state,route){
			state.route = route.r;
		},
	},
	actions: {
	},
	modules: {
	}
})
